// src/components/Receipt.js
import React from 'react';

const Receipt = () => {
  return (
    <div>
        <nav id = "desktop-nav">
            <div class = "Name"> E-Wallet </div>
            <div>
                <ul class ="nav-links">
                <button><a href="/register" >Register</a></button>
                </ul>
            </div>
        </nav>   
    </div>
  );
};

export default Receipt;
